                        <LazyUpload {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/components/extra/editor"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyEditor {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/components/extra/drag-and-drop"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyDragAndDrop {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/components/extra/input-tags"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyInputTags {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/components/extra/switches"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazySwitches {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/components/extra/toastr"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyToastr {...matchprops} />
                     </Suspense>
                  )}
               />
               {/* Forms */}
               <MainLayoutRoutes
                  exact
                  path="/forms/elements/inputs"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyInputs {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/forms/elements/input-grids"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyInputGrids {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/forms/layouts/basic-forms"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyBasicForms {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/forms/layouts/bordered-forms"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyBorderedForms {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/forms/layouts/form-actions"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyFormActions {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/forms/layouts/hidden-labels"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyHiddenLabels {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/forms/layouts/horizontal-forms"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyHorizontalForms {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/forms/layouts/striped-rows"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyStripedRows {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/forms/validation"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyValidation {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/forms/wizard"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyWizard {...matchprops} />
                     </Suspense>
                  )}
               />
               {/* Tables */}
               <MainLayoutRoutes
                  exact
                  path="/tables/regular"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyRegular {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/tables/extended"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyExtended {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/react-tables/regular"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyRegular {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/react-tables/extended"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyReactTableExtended {...matchprops} />
                     </Suspense>
                  )}
               />

               {/* Cards */}
               <MainLayoutRoutes
                  exact
                  path="/cards/basic-card"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyBasicCard {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/cards/extended-card"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyExtendedCard {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/cards/statistic-card"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyStatisticCard {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/cards/advanced-card"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyAdvancedCard {...matchprops} />
                     </Suspense>
                  )}
               />
               {/* Chart Views */}
               <MainLayoutRoutes
                  exact
                  path="/charts/chartist"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyChartist {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/charts/chartjs"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyChart {...matchprops} />
                     </Suspense>
                  )}
               />
               {/* Maps Views */}
               <MainLayoutRoutes
                  exact
                  path="/google-maps"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyGoogle {...matchprops} />
                     </Suspense>
                  )}
               />

               {/* Saperate Pages Views */}
               <FullPageLayout
                  exact
                  path="/pages/forgot-password"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyForgotPassword {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
                  path="/pages/horizontal-timeline"
                  render={matchprops => (
                     <Suspense fallback={<Spinner />}>
                        <LazyHorizontalTimeline {...matchprops} />
                     </Suspense>
                  )}
               />
               <MainLayoutRoutes
                  exact
